data.gameDesc:
Charge a powerful cannon with paint and fight jelly monsters! Spray the slugs with paint and make them inflate and explode in parts.

The unique paint mechanics allows you to paint everything around - if you get tired of shooting at enemies, you can always draw something on the nearest wall. Never before has a shooter been so colorful and fun!

Features of the game:
1. Realistic paint behavior;
2. Physical enemies that can be blown up in parts;
3. Bright graphics and juicy effects;
4. Lots of cool guns;
5. Endless levels.

Accept the challenge and plunge into the world of adventure! Shoot, blow up and paint everything around in this exciting game!

This is an exciting game for everyone - pull the slingshot, fire a saw and cut all the enemies! Defeat the stickmen wave after wave.

Defend the tower with a super shuriken, saw, cannon and other cool weapons! Be careful - armies of stickmen are coming all the time. Upgrade your weapons to become stronger and faster to cut armies of stickmen.

There are an infinite number of levels - you definitely won't be able to pass them all. The battles are getting harder every level, and your skills of shooting are getting higher!

Features of this game:
- juicy destruction of enemies;
- endless levels;
- a large variety of different cool weapons;
- nice and beautiful graphics;
- fast and interesting gameplay;
- simple control.

A jump kick in the style of kung fu masters, the strongest kick in the style of "This is Sparta!" and other cool techniques to fight criminals will be your weapon in this new parkour game about escaping from the lair of enemies!

Overcome obstacles, defeat enemies, run with all your might. The main thing is not to stumble!

No one can stop you if you have time to react to all enemies and obstacles. It's not easy, but do you want to become a real superhero and a master of parkour?

You will definitely fall in love with this game because it has:

1. A lot of opponents - from the weakest to powerful bosses;
2. Endless levels;
3. A variety of superheroes;
4. Interesting locations;
5. Cool parkour tricks;
5. Excellent graphics and an adventurous atmosphere.

Become a new hero, prove your strength!

This is a very cool game with a flying ninja stickman who uses super different weapons to cut all the evil stickmen on the level!

You can use swords, knifes, axes to cut the enemies. Don't forget to unlock new weapons!

Features of this game:
1. All enemies die by physics, with a ragdoll;
2. Many different bosses;
3. Different types of weapons that open up during the game;
4. Fast and addictive gameplay, which is easy to understand;
5. Simple controller;
6. Countless levels.

Ball Paint is an addictive new 3D game with tons of levels, Zen gameplay and hypnotic overtones!

How to play:
- Sliding the screen to adjust the aiming angle;
-Launch coloured balls on shapes to paint them;
- Try to paint it all in one color!

Features:
- unlimited levels with new colors and geometric shapes;
- Satisfying Zen gameplay;
-Easy to pick up;
